  - 👆🏻🇸🇬 ‍新加坡
  - 👆🏻🇯🇵 ‍日本
  - ✈️ ‍起飞
  - 🛩️ ‍墙内
- name: 🌐 ‍未知站点
  type: select
  proxies:
  - ✈️ ‍起飞
  - 🛩️ ‍墙内
  - 💩 ‍广告
- name: 🇭🇰 ‍香港
  type: url-test
  tolerance: 100
  use: &id002
  - HK
- name: 🇹🇼 ‍台湾
  type: url-test
  tolerance: 100
  use: &id003
  - TW
- name: 🇨🇳 ‍中国
  type: url-test
  tolerance: 100
  use: &id004
  - HK
  - TW
- name: 🇸🇬 ‍新加坡
  type: url-test
  tolerance: 100
  use: &id005
  - SG
- name: 🇯🇵 ‍日本
  type: url-test
  tolerance: 100
  use: &id006
  - JP
- name: 🇺🇸 ‍美国
  type: url-test
  tolerance: 300
  use: &id007
  - US
- name: 🎏 ‍其他
  type: url-test
  tolerance: 100
  use: &id008
  - p_All_Other
- name: 👆🏻 ‍指定
  type: select
  use: *id001
- name: 👆🏻🇭🇰 ‍香港
  type: select
  use: *id002
- name: 👆🏻🇹🇼 ‍台湾
  type: select
  use: *id003
- name: 👆🏻🇨🇳 ‍中国
  type: select
  use: *id004
- name: 👆🏻🇸🇬 ‍新加坡
  type: select
  use: *id005
- name: 👆🏻🇯🇵 ‍日本
  type: select
  use: *id006
- name: 👆🏻🇺🇸 ‍美国
  type: select
  use: *id007
- name: 👆🏻🎏 ‍其他
  type: select
